import React from 'react';
import Project from './Project';

const test = {
    name: 'Brewery Finder Web Application',
    description: 'A web application for finding and navigating to local breweries',
    id: 1,
  };
  
function Navigation() {
    return (
      <div>
        <Project name={test.name} description={test.description} id={test.id} />
      </div>
    );
  }
  
  export default Navigation;
